import React, { useState } from 'react';
import TopNav from '../components/TopNav';
import { Container, Row, Col, Card, Form, Button } from 'react-bootstrap';
import { predictSingle } from '../services/api';
import { toast } from 'react-toastify';

export default function PredictSingle() {

  const [form, setForm] = useState({
    academic_score: 75,
    motivation_level: 3,
    attendance_rate: 80
  });

  const defaultPayload = {
    passed_out_10: 2022,
    passed_out_11: 2023,
    passed_out_12: 2024,
    marks_10: 80,
    marks_11: 80,
    marks_12: 80,
    family_income: 20000,
    family_members: 4,
    district: "Chennai",
    school_type_10: "Government",
    school_type_11: "Government",
    school_type_12: "Government",
    orphan: "No",
    single_parent: "No",
    girl_child: "No",
    communication_frequency: "Medium",
    family_support: "Medium",
    extra_curricular: "No",
    interest_level: "Medium",
    attitude: "Respectful",
    school_fee_6_to_12: "10k-20k"
  };

  const [result, setResult] = useState(null);

  const onChange = (k, v) =>
    setForm(s => ({ ...s, [k]: v }));

  const submit = async (e) => {
    e.preventDefault();
    try {
      const payload = { ...defaultPayload, ...form };
      const res = await predictSingle(payload);
      setResult(res);
      toast.success("Prediction done");
    } catch (err) {
      toast.error("Prediction failed");
    }
  };

  return (
    <>
      <TopNav />
      <Container className="p-4">
        <Row>
          <Col md={6}>
            <Card className="p-3 shadow-sm">
              <h5>Single Student Prediction</h5>

              <Form onSubmit={submit}>
                <Form.Group className="mb-2">
                  <Form.Label>Academic Score</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.academic_score}
                    onChange={e => onChange("academic_score", +e.target.value)}
                  />
                </Form.Group>

                <Form.Group className="mb-2">
                  <Form.Label>Motivation Level (1–5)</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.motivation_level}
                    onChange={e => onChange("motivation_level", +e.target.value)}
                  />
                </Form.Group>

                <Form.Group className="mb-2">
                  <Form.Label>Attendance Rate (%)</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.attendance_rate}
                    onChange={e => onChange("attendance_rate", +e.target.value)}
                  />
                </Form.Group>

                <Button type="submit">Predict</Button>
              </Form>

            </Card>
          </Col>

          <Col md={6}>
            <Card className="p-3 shadow-sm">
              <h5>Prediction Result</h5>

              {result ? (
                <div>
                  <p><strong>Dropout Probability:</strong> {result.dropout_probability}</p>
                  <p><strong>Deservingness Score:</strong> {result.deservingness_score}</p>
                  <p><strong>Risk Tier:</strong> <span className={`badge ${result.risk_tier === "HIGH" ? "bg-danger" : "bg-success"}`}>{result.risk_tier}</span></p>
                </div>
              ) : (
                <p className="text-muted">No result yet — fill fields and predict.</p>
              )}

            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
}
